class ProjectUpdateStatusRequestModel {  int? manageProjectId;  int? projectStatusId;  int? ratio;  ProjectUpdateStatusRequestModel({this.manageProjectId, this.projectStatusId, this.ratio});  ProjectUpdateStatusRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['project_id'];    projectStatusId = json['project_status_id'];    ratio = json['progress'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['project_id'] = this.manageProjectId;    data['project_status_id'] = this.projectStatusId;    data['progress'] = this.ratio;    return data;  }}